import React from 'react';
import s from "Household.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";

const Household = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={'Недвижимость'} imgPath={'./architect.svg'} urlCategory={'nedvijimost'}/>
            <Category nameCategory={'Транспорт'} imgPath={'./auto.svg'} urlCategory={'transport'}/>
            <Subcategories nameSubCat={'Бытовая техника'} imgPath={'./architect.svg'} urlSubcategory={'bitovaya_technika'}/>
            <Subcategories nameSubCat={'Мебель'} imgPath={'./architect.svg'} urlSubcategory={'mebel'}/>
          </div>
        </div>
      </div>
  );
};

export default Household;
